import React from "react";
import JSONPretty from "react-json-pretty";

export default function ApiResponse (props) {
    return(
      <div>
        <div className="form-group">
          <JSONPretty
            id="json-pretty"
            data={this.props.api}
            space="4"
          ></JSONPretty>
        </div>
      </div>
  )
}
